import Navbar from "../components/Navbar";
import Menu from "../components/Menu";
import DashboardCard from "../components/DashboardCard";
import Btn from "../components/Btn";
import "../styles/profile.css";
import iconNewPhoto from "../assets/iconNewPhoto.jpg";

const Profile = () => {
  return (
    <>
      <div className="gridContainer">
        <Menu />
        <Navbar titlePage="PROFILE" />
        <div id="containerDashboardCard">
          <DashboardCard style={{ gridColumn: "1 / 3", gridRow: "1 / 5" }}>
            <div id="firstElipse">
              <div id="secondElipse">
                <img id="iconNewPhoto" src={iconNewPhoto} />
              </div>
            </div>
          </DashboardCard>
          <DashboardCard
            style={{ gridColumn: "3 / 5", gridRow: "1 / 5" }}
          ></DashboardCard>
          <DashboardCard
            style={{ gridColumn: "5 / 7", gridRow: "1 / 5" }}
          ></DashboardCard>
          <Btn title="Supprimer le compte" />
        </div>
      </div>
    </>
  );
};
export default Profile;
